import React, { Component } from 'react';
import LineChart from 'react-linechart';
import './Linestyle.css';
export default class Linechart extends Component {
    render() {
        const data = [
            {									
                color: "steelblue", 
                points: [{x: 1, y: 2}, {x: 3, y: 5}, {x: 7, y: -3},{x: 3, y: 5}, {x: 6, y: 7}, {x: 7, y: -3}] 
            }
        ];
        return (
            <div>
                <div className="App">
                    <LineChart 
                        width={250}
                        height={250}
                        data={data}
                    />
                </div>				
            </div>
        );
    }
}
